import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import nuub_logo_white from "../assets/img/cropped-nuub_logo white.png";
import { Facebook, Instagram, Linkedin } from "react-bootstrap-icons";

const Footer = () => {
  return (
    <>
      <Container
        fluid
        style={{
          backgroundColor: "#2D2828",
          width: 1577,
          height: 500,
          textAlign: "center",
          fontFamily: "primary-font",
          color: "white",
        }}
      >
        <Row>
          <Col xs={4} lg={5} style={{ marginTop: "8rem" }}>
            <img src={nuub_logo_white} />
            <h2
              style={{ color: "whitesmoke", fontSize: 35, marginTop: "3rem" }}
            >
              Web Design and Integration
            </h2>
          </Col>
          <Col>
            <div
              style={{
                height: 420,
                borderLeft: "0.5px solid whitesmoke",
                position: "absolute",
                marginLeft: "8rem",
              }}
            ></div>
          </Col>
          <Col
            xs={4}
            lg={5}
            style={{
              marginTop: "9rem",
              marginRight: "3rem",
            }}
          >
            <h2>Herstedvang 7C, 1. sal 2620 Albertslund</h2>
            <h2>CVR: 35528970</h2>
            <h2>Tlf. 43 45 43 44</h2>
            <h2>support@nuub.dk</h2>
            <Facebook size={25} />
            <Instagram size={25} />
            <Linkedin size={25} />
          </Col>
        </Row>
      </Container>
    </>
  );
};

export default Footer;
